import React from 'react'
import { Form, Input, Button } from 'antd'

const dummy = {
    isLoggedIn: true
}

// rafce
const Home = () => {
    return (
        <>
            <div>
                {dummy.isLoggedIn && (
                    <Form encType="multipart/form-data">
                        <Input.TextArea maxLength={140} placeholder="무슨 일이 있었나요?"></Input.TextArea>
                        <div>
                            <Button type="primary" style={{ flow: 'right' }}>짹짹</Button>
                        </div>
                    </Form>
                )}
            </div>
        </>
    )
}

export default Home
